		"text": "분명 자신을 갉아 먹는 일이지만 이미 언팔로우/싫어요 에 상처받고 마는 상태가 되어어 그만둘 수도 없는 것. \n선미는 피를 흘리며 쓰러져 있는 것처럼 실재가 아닌 허구의 \"고통\"을 \"연출\"하고, 그걸 보는 사람들이 하는 말은 \"개쩐다\" https://t.co/LGvsqdf9PD"
